(40, 'How to handle stress', 'This news story can feature interviews with children about how they handle stress in their lives. It can also provide tips on how to deal with stress and anxiety for children.', '2023-05-09 15:44:56', '645a6a788e8643.03605863.png'),
(41, 'Why it\'s important to talk about your feelings', '-> The importance of talking about their feelings with a trusted adult or friend.\r\n\r\n->It can also provide tips on how to start the conversation and what to say.', '2023-05-09 15:58:08', '645a6d909fc7d8.96214259.png'),
(42, 'The benefits of exercise for mental health', '-> News story can explain how exercise can help improve mental health and reduce stress and anxiety.\r\n-> It can also provide fun exercise ideas for children to try.\r\n-> Try some fun activity for kids that does not stress the kids', '2023-05-09 15:59:01', '645a6dc571aa67.04183889.png'),
(43, 'How to help a friend who is struggling with mental health', '-> This news story can provide tips on how to be a supportive friend to someone who is struggling with their mental health.\r\n\r\n->The importance of seeking help from a trusted adult or mental health professional', '2023-05-09 16:00:11', '645a6e0bc900d4.38150319.png'),
(44, 'Always think positive', '-> Kids that having positive attitude and mindset can help improve their mental health.\r\n\r\n-> Provide simple tips on how to stay positive, like focusing on the good things in life and practicing gratitude.', '2023-05-09 16:01:58', '645a6e76735571.75881247.png'),
(45, 'It\'s okay to feel sad sometimes', '-> Kids that feeling sad or upset is a normal part of life and that it\'s okay to ask for help or talk to someone they trust if they\'re feeling down.', '2023-05-09 16:02:39', '645a6e9f1de038.73616503.png'),
(46, 'Taking care of your mental health is just as important as taking care of your physical health', '-> They need to eat healthy.\r\n\r\n-> Need to take care of their mental health by doing things like talking to friends, getting enough sleep, and doing activities they enjoy', '2023-05-09 16:03:37', '645a6ed93d3ef9.94999944.png');

